function GoogleSearch() {
    return (
        <div>
            <h3>Google Search</h3>
            <form className="" method="GET" action="https://www.google.com/search">
                <input name="q" type="text" />
                <input type="submit" />
            </form>
        </div>
    )
}

export default GoogleSearch
